*
 * 显示页面底部的下载皮肤按钮，支持下载并应用皮肤功能
 *
 * 支持平台：书旗Android
 *
 * @return {Promise.<void>}
 *
 * @example
 * const params = {
 *   id: '999',
 *   imgUrl: 'http://img-tailor.11222.cn/pm/app/2017JulTue73c16cdc3369b7b2e66f68a9c7ff54a5.png',
 *   name: '默认皮肤',
 *   size: '406590',
 *   downloadUrl: 'http://asq-skins.oss-cn-hangzhou.aliyuncs.com/android/1.3/1000_d7333ce337809957ba7578131fe34b70.zip',
 *   desc: '书旗专属经典皮肤，繁星点缀的夜空，奇幻美妙的旅程。如海洋般浩瀚无际，夜幕下，幽蓝的海水里，点点星光，编织出神秘深邃的梦境。选择恐惧症的朋友们，经典默认款是你的不二之选。\\n\\n',
 *   version: '1.0',
 * };
 * libSQ.exec('show-skin-download-btn', {
 *   params,
 * }).then((info) => {
 *   alert(`[show-skin-download-btn][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[show-skin-download-btn][error] ${JSON.stringify(err, null, 2)}`);
 * });

